import React from "react";
import "./PlatformNavbar.sass";

const PlatformNavbar = () => {
  return (
    <nav className="platform-nav">
      <ul className="platform-nav__list">
        <li className="platform-nav__list-item">1</li>
        <li className="platform-nav__list-item">2</li>
        <li className="platform-nav__list-item">3</li>
        <li className="platform-nav__list-item">4</li>
      </ul>
    </nav>
  );
};

export default PlatformNavbar;
